import React, { Component } from 'react';
import { Container, Typography } from '@material-ui/core';

class Inicio extends Component {
    render() {
        return (
            <Container maxWidth="sm">
                <Typography component="div" />
            </Container>
        );
    }
}

export default Inicio;
